BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "verification_table" (
	"id"	TEXT,
	"isVerified"	INTEGER DEFAULT 0
);
CREATE TABLE IF NOT EXISTS "Party" (
	"id"	TEXT,
	"name"	TEXT,
	"board_address"	TEXT
);
CREATE TABLE IF NOT EXISTS "Registrar" (
	"name"	TEXT,
	"email"	TEXT,
	"uname"	TEXT,
	"pword"	TEXT,
	"private_key"	TEXT,
	"public_key"	TEXT
);
CREATE TABLE IF NOT EXISTS "President" (
	"party_id"	TEXT,
	"id"	TEXT,
	"name"	TEXT,
	"portfolio"	TEXT,
	"age"	INTEGER,
	"desc"	TEXT
);
CREATE TABLE IF NOT EXISTS "Parliament" (
	"party_id"	TEXT,
	"id"	TEXT,
	"name"	TEXT,
	"age"	TEXT,
	"constituency"	TEXT,
	"description"	TEXT
);
CREATE TABLE IF NOT EXISTS "Election" (
	"id"	TEXT,
	"address"	TEXT,
	"result"	TEXT
);
CREATE TABLE IF NOT EXISTS "Voters" (
	"username"	TEXT DEFAULT 'user',
	"password"	TEXT,
	"voterId"	TEXT,
	"constituency"	TEXT,
	"hasVoted"	INTEGER DEFAULT 0
);
